import React from 'react';
import '../styles/chatWindow.css';

const Message = ({ message }) => {
    return (
        <div className={`message ${message.sender === 'me' ? 'sent' : 'received'}`}>
            <p>{message.text}</p>
            <span>{message.timestamp}</span>
        </div>
    );
};

export default Message;
